GPU operations are typically asynchronous with respect to the host. Allocations and transfers typically block the host thread, while operations like convolutions are simply enqueued and do not block. In a typical pattern, data is copied to the gpu, the operations are carried out, and the output is copied back to the host. No explicit synchronization is necessary, in fact the CUDA runtime synchronizes as needed. To explicity synchronize, and wait for all operations on the gpu to finish, call Device::synchronize(): let device = Device::from(CudaGpu::new());
let x = Tensor::<u8>::ones(&device, 10) .to_one_hot_f32(16);
// wait for execution to finish
device.synchronize(); This can be useful for timing / benchmarking.

