A tensor is a mathmatically generalization of a vector in n dimensions. Typically this means storing a vector of data and a vector of dimensions. #[derive(Clone)]
pub struct TensorBase<S: Data, D: Dimension> { ... } Similar to ndarray's ArrayBase, TensorBase<S, D> is generic over the storage S and dimension D. S is required to implement the Data trait, which is sealed (not able to be implemented outside the crate): /// Main trait for Tensor S generic parameter, similar to ndarray::Data. Elem indicates that the Tensor stores that datatype.
pub trait Data: PrivateData { type Elem: Num;
} The Dimension trait looks like this: pub trait Dimension: Clone + Eq + Debug + Send + Sync + Default + IndexMut<usize, Output = usize> + Add<Self, Output = Self> + AddAssign + for<'x> AddAssign<&'x Self> + Sub<Self, Output = Self> + SubAssign + for<'x> SubAssign<&'x Self> + Mul<usize, Output = Self> + Mul<Self, Output = Self> + MulAssign + for<'x> MulAssign<&'x Self> + MulAssign<usize> { type SliceArg: ?Sized + AsRef<[SliceOrIndex]>; type Pattern: IntoDimension<Dim = Self> + Clone + Debug + PartialEq + Eq + Default; type Smaller: Dimension; type Larger: Dimension + RemoveAxis; const NDIM: Option<usize>; fn ndim(&self) -> usize; fn into_pattern(self) -> Self::Pattern; fn zeros(ndim: usize) -> Self; fn __private__(&self) -> PrivateMarker; fn size(&self) -> usize { ... } fn size_checked(&self) -> Option<usize> { ... } fn as_array_view(&self) -> ArrayView1<Ix> { ... } fn as_array_view_mut(&mut self) -> ArrayViewMut1<Ix> { ... } fn into_dyn(self) -> IxDyn { ... }
} Dimensions: Ix0 (scalar) Ix1 (vector) Ix2 (matrix) Ix3 (3d tensor) Ix4 (4d tensor ie 2d image) Ix5 (5d tensor ie 3d image) Ix6 (6d tensor) IxDyn (Nd tensor) Rather than constructing a Dimension directly, most functions in autograph use the IntoDimension trait: pub trait IntoDimension { type Dim: Dimension; fn into_dimension(self) -> Self::Dim;
} This is implemented in ndarray for several types: usize -> Ix0 (usize, usize) | [usize; 2] -> Ix2 (usize, usize, usize) | [usize; 3] -> Ix3 (usize, usize, usize, usize) | [usize; 4]` -> Ix4 (usize, usize, usize, usize, usize) | [usize; 5]` -> Ix5 (usize, usize, usize, usize, usize, usize) | [usize; 6] -> Ix6 &[usize] -> IxDyn Similar to Array1, Array2, ArrayD, there are type aliases for Tensors as well, like Tensor1, Tensor2, TensorD, or TensorView1, TensorView2, TensorViewD etc.

