Cow (Copy On Write) is a "Smart Pointer" that is an enum, representing either Owned or Borrowed data. If the data is owned, it can be moved into the new container (ie a cpu Tensor). For gpu tensors, the data must be copied to gpu memory, so there is no advantage to passing an owned Vec over a slice. Often, data is not owned but borrowed. Instead of forcing the user to copy the data before calling the constructor, the user can provide the slice instead, allowing the implementation to choose when to copy the data, avoiding a second copy from the Vec to gpu memory. The primary way to contruct a Tensor is with TensorBase::from_shape_vec: /// Constructs a Tensor on the device with the given shape. If a Vec is provided, will move the data (ie no copy) if the device is a cpu. Can also provide a slice, which allows for the data to only be copied once (rather than twice in the case of copying to the gpu). /// Panics: Asserts that the provided shape matches the length of the provided vec or slice. ///
pub fn from_shape_vec<'a>( device: &Device, shape: impl IntoDimension<Dim = D>, vec: impl Into<Cow<'a, [T]>>,
) -> Self; Both Vec<T> and &[T] implement Into<Cow<[T]>, so this method can be called with a slice as well. The same is true for TensorBase::from_array: /// Similar to from_shape_vec, can accept either an Array or an ArrayView /// Copies that data to standard (packed) layout if necessary
pub fn from_array<'a>(device: &Device, array: impl Into<CowArray<'a, T, D>>) -> Self;
